import { Page, PageHeader } from "@/components/Page";
import { PostType } from "@/utils/types";
import { FlatList, SafeAreaView, StyleSheet, View } from "react-native";
import { Post } from "../post-details";
import { DotLoader } from "@/components/Sync";
import { useEffect, useState } from "react";
import { API_BASE_URL } from "@/utils/config";
import axios from "axios";
import Colors from "@/constants/Colors";

export default function ClubsScreen() {
    const [posts, setPosts] = useState<PostType[]>([]);
    const [isFirstLoading, setIsFirstLoading] = useState(true);
    const [isLoading, setIsLoading] = useState(true);
    const [offset, setOffset] = useState(0);

    const fetchLatestPost = async (offset: number): Promise<PostType> => {
        // Simulation chargement de 1s
        await new Promise((resolve) => setTimeout(resolve, 1000));
        return {
            title: "Soirée : Terrasse de l’Ile",
            description:
                "Rejoignez nous sur la terrasse de l’île. Une boisson sera offerte pour les premiers inscrits !",
            date: "28/02/2024",
            club: {
                name: "BDE",
                image: "data:image/png;base64,"
            },
            type: "event",
            address: "21 quai des antilles, 44200 Nantes",
            imageUri:
                "data:image/png;base64,",
            info: {
                ageLimit: "18 ans",
                price: "Gratuite",
                startTime: "18h30"
            },
            link: "https://google.com"
        };

        // try {
        //     //On récupère le X dernier post
        //     const response = await axios.get(
        //         `${API_BASE_URL}/v1/posts/latest?offset=${offset}`
        //     );
        //     return response.data.post;
        // } catch (error) {
        //     console.error("Erreur lors de la récupération des posts :", error);
        //     return [];
        // }
    };

    //On charge les posts un par un
    const loadPosts = async () => {
        setIsLoading(true);
        const newPosts = await fetchLatestPost(offset);

        setPosts((prev) => [...prev, newPosts]);
        setOffset((prev) => prev + 1);
        setIsLoading(false);
    };

    useEffect(() => {
        //On charge les 3 premiers posts au démarrage
        const loadInitialPosts = async () => {
            for (let i = 0; i < 3; i++) {
                await loadPosts();
            }
            setIsFirstLoading(false);
        };
        loadInitialPosts();
    }, []);

    return (
        <SafeAreaView style={styles.container}>
            <View style={styles.content}>
                <PageHeader title="Clubs"></PageHeader>
                <FlatList
                    data={posts}
                    contentContainerStyle={styles.scrollContainer}
                    keyExtractor={(_, index) => index.toString()}
                    renderItem={({ item }) => <Post post={item} />}
                    onEndReached={() => {
                        //Si le chargement initial est terminé, on charge les nouveaux posts
                        if (!isFirstLoading && !isLoading) {
                            loadPosts();
                        }
                    }}
                    onEndReachedThreshold={0.5}
                    ListFooterComponent={isLoading ? <DotLoader /> : null}
                />
            </View>
        </SafeAreaView>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: Colors.white
    },
    content: {
        flex: 1,
        paddingBlock: 10,
        paddingInline: 20,
        backgroundColor: Colors.white,
        gap: 25
    },
    scrollContainer: {
        alignSelf: "center"
    }
});
